import { TitleFd, ListFd, ItemFd, BtnFd } from "./Feedback.styled";

export const Feedback = ({ options, onLeaveFeedback }) => {
  return (
    <>
      <TitleFd>Please leave feedback</TitleFd>
      <ListFd>
        {options.map((option) => {
          return (
            <ItemFd>
              <BtnFd onClick={onLeaveFeedback(option)}>Good</BtnFd>
            </ItemFd>
          );
        })}
      </ListFd>
    </>
  );
};
